export default function NavBar() {
    // const classes = useStyles();
    return (
        <AppBar position='static'>
            <Toolbar >
                <div >
                    <Button variant="contained" to={"/home"} component={Link}>
                        Home
                    </Button>
                    <Button variant="contained" to={"/addMovie"} component={Link}>
                        Add Movie
                    </Button>
                    <LoginStatus/>
                </div>
            </Toolbar>
        </AppBar>
    )
}
